const customFileUpload=inputSelector=>{const customFileInput=".custom-file-input";const customFileLabel=".custom-file-label";const handleFileName=({target})=>{const fileName=target.value.split("\\").pop();$(target).siblings(customFileLabel).addClass("selected").addClass("text-truncate").html(fileName);};const selector=inputSelector||customFileInput;$(selector).change(event=>handleFileName(event));};customFileUpload("#customFile");$(()=>$('[data-toggle="tooltip"]').tooltip());$("#form-submit").click(()=>$("#upload-form").submit());const notificationFadeOut=(selector,timeout=5000)=>selector.fadeTo(timeout,0.7);notificationFadeOut($(".notification.alert.alert-info"));notificationFadeOut($(".notification.alert.alert-success"));notificationFadeOut($(".notification.alert.alert-warning"));notificationFadeOut($(".notification.alert.alert-danger"));const toggleOrderDetails=event=>{const{target}=event;const{id}=target;const orderSelector="tr";const orderDetailsClass="table-info font-weight-bold";const orderItemSelector=`.${id}`;$(orderItemSelector).toggle("fast");const order=$(target).parents(orderSelector);order.hasClass(orderDetailsClass)?order.removeClass(orderDetailsClass):order.addClass(orderDetailsClass);};$(".order-details-toggler").click(event=>toggleOrderDetails(event));